        <h2 class="indent-bottom-sm">About Bug Free Grains</h2>
        <p>The lineup of Bug Free Grains Stored Product Solutions from Central Life Sciences helps prevent stored grain insect infestations to keep your grain whole. Bug Free Grains products work to help reduce the rejection rate of your grains so that you can keep more profits. The product lineup, complete with insect growth regulators, insecticides, and synergists, can help control insects in stored commodities from start to finish.</p>
